import nl.rijksoverheid.ctr.holder.HolderMainActivity
import nl.rijksoverheid.ctr.introduction.persistance.IntroductionPersistenceManager
import nl.rijksoverheid.ctr.persistence.PersistenceManager
import nl.rijksoverheid.ctr.shared.models.DisclosurePolicy
import okhttp3.Headers
import org.junit.Before
import org.koin.core.context.loadKoinModules
import org.koin.core.module.Module
import org.koin.dsl.module
import org.koin.test.AutoCloseKoinTest
import org.koin.test.inject

abstract class BaseTest : AutoCloseKoinTest() {

    private val persistenceManager: PersistenceManager by inject()
    private val introductionPersistenceManager: IntroductionPersistenceManager by inject()
    private val appUpdatePersistenceManager: AppUpdatePersistenceManager by inject()

    private lateinit var scenario: ActivityScenario<HolderMainActivity>

    fun launchApp(): ActivityScenario<HolderMainActivity> {
        return ActivityScenario.launch(HolderMainActivity::class.java)
    }

    fun overrideModules(modules: List<Module>) {
        loadKoinModules(listOf(module {
            factory {
                PreferenceManager.getDefaultSharedPreferences(instrumentation.targetContext)
            }
        }, module {
            factory<ConfigRepository> {
                object : ConfigRepository {
                    override suspend fun getConfig(): ConfigResponse {
                        val moshi = Moshi.Builder()
                            .add(DisclosurePolicyJsonAdapter()).build()
                        val jsonAdapter: JsonAdapter<HolderConfig> =
                            moshi.adapter(HolderConfig::class.java)
                        val holderConfigString = jsonAdapter.toJson(
                            HolderConfig.default(
                                disclosurePolicy = DisclosurePolicy.ZeroG,
                                backendTLSCertificates = listOf(
                                    "",
                                    ""
                                ),
                                hpkCodes = listOf(
                                    AppConfig.HpkCode(
                                        code = "2924528",
                                        name = "Comirnaty (Pfizer)",
                                        displayName = "PFIZER INJVLST 0,3ML",
                                        vp = "1119349007",
                                        mp = "EU/1/20/1528",
                                        ma = "ORG-100030215"
                                    ), AppConfig.HpkCode(
                                        code = "3017842",
                                        name = "Comirnaty (Pfizer)",
                                        displayName = "PFIZER ORIG/OMICRON BA.1 INJ 0,3ML",
                                        vp = "1119349007",
                                        mp = "EU/1/20/1528",
                                        ma = "ORG-100030215"
                                    ), AppConfig.HpkCode(
                                        code = "3017885",
                                        name = "Comirnaty (Pfizer)",
                                        displayName = "PFIZER ORIG/OMICRON B4-5 INJ 0,3ML",
                                        vp = "1119349007",
                                        mp = "EU/1/20/1528",
                                        ma = "ORG-100030215"
                                    ),
                                    AppConfig.HpkCode(
                                        code = "2924536",
                                        name = "Spikevax (Moderna)",
                                        displayName = "MODERNA INJVLST 0,5ML",
                                        vp = "1119349007",
                                        mp = "EU/1/20/1507",
                                        ma = "ORG-100031184"
                                    ),
                                    AppConfig.HpkCode(
                                        code = "2925508",
                                        name = "Vaxzevria (AstraZeneca)",
                                        displayName = "ASTRAZENECA INJVLST",
                                        vp = "J07BX03",
                                        mp = "EU/1/21/1529",
                                        ma = "ORG-100001699"
                                    ), AppConfig.HpkCode(
                                        code = "2934701",
                                        name = "Jcovden (Janssen)",
                                        displayName = "JANSSEN INJVLST 0,5ML",
                                        vp = "J07BX03",
                                        mp = "EU/1/20/1525",
                                        ma = "ORG-100001417"
                                    )
                                ),
                                euBrands = listOf(
                                    AppConfig.Code(
                                        code = "EU/1/20/1507",
                                        name = "Spikevax (Moderna)"
                                    ), AppConfig.Code(
                                        code = "EU/1/20/1528",
                                        name = "Comirnaty (Pfizer)"
                                    ), AppConfig.Code(
                                        code = "EU/1/20/1525",
                                        name = "Jcovden (Janssen)"
                                    )
                                )
                            )
                        )
                        return ConfigResponse(
                            body = holderConfigString,
                            headers = Headers.headersOf()
                        )
                    }

                    override suspend fun getPublicKeys(): String {
                        return "{\"cl_keys\":[],\"nl_keys\":{\"VWS-ACC-0\":{\"public_key\":\"\"},\"VWS-ACC-1\":{\"public_key\":\"\"},\"VWS-ACC-2\":{\"public_key\":\"\"},\"VWS-ACC-3\":{\"public_key\":\"\"}}}"
                    }
                }
            }
        }) + modules)
    }

    @Before
    fun startApp() {
        overrideModules(listOf())

        persistenceManager.setHasDismissedUnsecureDeviceDialog(true)
        persistenceManager.setHasDismissedRootedDeviceDialog()

        introductionPersistenceManager.saveIntroductionFinished()
        appUpdatePersistenceManager.saveNewFeaturesSeen(3)
        appUpdatePersistenceManager.saveNewTermsSeen(2)
        persistenceManager.setPolicyScreenSeen(DisclosurePolicy.ZeroG)
        persistenceManager.setSelectedDashboardTab(1)

        scenario = launchApp()
    }

    companion object {
        private val instrumentation: Instrumentation = InstrumentationRegistry.getInstrumentation()
        val device: UiDevice = UiDevice.getInstance(instrumentation)
        val today: LocalDate = LocalDate.now()
        val authPassword: String =
            InstrumentationRegistry.getArguments().getString("authPassword", "")
    }
}
